import React from 'react';
import { Container } from "react-bootstrap";
import { observer } from 'mobx-react-lite';
import NavBar from '../components/navbar';

const Main_page = observer(() => {

    return(
        <div>
            <NavBar/>
        <Container>
            <p>Главная</p>
        </Container>
        </div>
    )
});

export default Main_page;
